(function () {
  var instance = document.createElement('object');
  if (
    !instance.constructor.name &&
    Object.prototype.toString.call(instance) === '[object Object]'
  ) {
    return { result: null, message: 'Detection methods unsupported' };
  }
  if (
    instance.constructor.name !== 'HTMLObjectElement' &&
    Object.prototype.toString.call(instance) !== '[object HTMLObjectElement]'
  ) {
    return false;
  }
  return !!instance;
})();

